import React from 'react';

const UserCard = ({ users }) => {
  return (
    <div className="user-card-container">
      {users.map((user) => (
        <div key={user.email} className="user-card">
          <p>{user.name}</p>
          <p>Email: {user.email}</p>
        </div>
      ))}
    </div>
  );
};

export default UserCard;
